__NUXT_JSONP__("/svet/stat/marshallovy-ostrovy/cesta", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q){return {data:[{place:[{tld:".mh",name:"Marshallovy ostrovy",area:181,population:59190,slug:i,id_continent:e,information_chatgpt:"\u003Cp\u003EMarshallovy ostrovy jsou ostrovní stát v Tichomoří, který se skládá z 29 atolů a 5 ostrovů. Nachází se v Micronésii, vzdálené přibližně 3500 km od Austrálie. Hlavním městem je město Majuro, které leží na ostrově Majuro.\u003C\u002Fp\u003E\n\u003Cp\u003EKolem Marshallů najdete neuvěřitelně čisté a průzračné vody, bílé písečné pláže a úchvatné koralové útesy. Vzhledem k tomu, že se jedná o malý stát, turisté zde najdou klid a příležitost k relaxaci na pláži. Výlety na okolní ostrovy nabízejí možnost objevovat tradiční kulturu a historii ostrova.\u003C\u002Fp\u003E\n\u003Cp\u003EVe státě se mluví několika jazyky, nejpoužívanější jsou angličtina a maršálština. Zajímavostí je, že se na Marshallových ostrovech používají jako měnu americké dolary. Země má také bohatou historii, zahrnující období německé kolonizace a japonské okupace během druhé světové války.\u003C\u002Fp\u003E\n\u003Cp\u003ECo se týče dopravy, nejlepším způsobem, jak se na Marshallových ostrovech pohybovat, je lodí nebo letadlem. Neexistují zde silniční spoje mezi jednotlivými ostrovy. Stejně tak jsou pro turisty k dispozici malé hotely a penziony, ale ne luxusní resorty.\u003C\u002Fp\u003E\n\u003Cp\u003EMarshallovy ostrovy mohou být skvělou volbou pro ty, kteří hledají klid a přírodu. Ostrovy nabízejí úchvatnou krásu a nezapomenutelné zážitky pro ty, kteří se rozhodnou navštívit tento malý kousek ráje.\u003C\u002Fp\u003E",currency_code:"USD",currency_name:"americký dolar",money_prices:[{name:"Taxi (cena za km)",value:a,date_update:b},{name:"Hlavní jídlo",value:a,date_update:b},{name:"Chleba",value:a,date_update:b},{name:"Mléko",value:a,date_update:b},{name:"Voda (500ml)",value:a,date_update:b},{name:"Espresso",value:a,date_update:b},{name:"Zmrzlina (jeden kopeček)",value:a,date_update:b},{name:"Pivo",value:a,date_update:b},{name:"Krabička cigaret",value:a,date_update:b},{name:"Bic Mac",value:a,date_update:b},{name:"Coca Cola (500ml)",value:a,date_update:b}],phone_numbers_emergency:[{name:"Mezinárodní tísňová linka",value:"112",date_update:f},{name:"Policie",value:"188",date_update:f},{name:"Hasiči",value:j,date_update:f},{name:"Zdravotnická záchranná služba",value:j,date_update:f}],phone_prefix:"+692",coordinates:[{latitude:"7.1315",longitude:"171.1845"}],people_religion:[{name:"Křesťanství",value:"97%"},{name:"Tradiční náboženství",value:"2%"},{name:"Jiné náboženství",value:"1%"}],people_nationality:[{name:"Mikronésané",value:"92%"},{name:"Polynésané",value:"5%"},{name:"Ostatní",value:"3%"}],visitors_entry:[{name:"Občanský průkaz",value:"Pro vstup na Marshallovy ostrovy je potřeba mít platný cestovní pas. Občanský průkaz není akceptován jako platný cestovní doklad.",date_update:b},{name:"Cestovní pas",value:"Pro vstup na Marshallovy ostrovy je potřeba mít platný cestovní pas.",date_update:b},{name:"Vízum",value:"Pro občany České republiky (a tedy i pro občany Evropské unie a Schengenského prostoru) není potřeba vízum pro krátkodobý pobyt do 90 dnů. Pokud však plánujete pobyt delší než 90 dnů nebo účast na placené činnosti, může být potřeba žádat o vízum. Více informací lze získat na stránkách Marshallových ostrovů.",date_update:b},{name:"Očkování",value:"Pro vstup na Marshallovy ostrovy není povinné očkování. Nicméně, doporučuje se být očkován proti běžným chorobám jako jsou spalničky, zarděnky a hepatitida A a B. Před cestou je vhodné poradit se s odborníkem na cestovní medicínu.",date_update:b},{name:"Cestovní pojištění",value:"Pro vstup na Marshallovy ostrovy není povinné mít cestovní ani zdravotní pojištění. Nicméně, doporučuje se mít uzavřené cestovní pojištění, které bude pokrývat případné lékařské výlohy či repatriaci v případě nouze. Některé země to vyžadují, proto je vhodné mít s sebou potvrzení o pojištění.",date_update:b},{name:"Bezpečnostní situace",value:"Na Marshallových ostrovech je obecně klidná bezpečnostní situace. Nicméně, doporučuje se být obezřetný a dodržovat základní bezpečnostní opatření jako například pečlivé sledování svého majetku a vyhýbání se nebezpečným čtvrtím v noci. V případě nouze lze kontaktovat místní policii.",date_update:b},{name:"Další informace",value:"Při cestování na Marshallovy ostrovy je vhodné mít s sebou dostatečné množství hotovosti, jelikož platební karty nejsou všude přijímány. Důležité je také dodržovat místní zvyklosti a respektovat místní kulturu. Mezi populární aktivity patří potápění a pozorování korálových útesů, ale také návštěva místních trhů a ochutnávka místní kuchyně.",date_update:b}],type_place:k,id_image_cover:g,id_image_hero:g,id_city_main:h,affiliate:[{name:l,value:m}],mpz:"MH",alerts:a,zoom:[{google:e,booking:7}],ids_neighboring_countries:[],organization:a,apps:a,links:a,information_author:a,seo_tags:a,language_phrases:a,wall_sockets:a,id:n,facts:a}],imagePlace:[{id:g,name:i,source:"\u002Fworld\u002Fstates\u002F",date_create:"2023-05-03T20:14:00.749527+00:00",type:k,author:"pixabay.com"}],placesStatesNeighboring:a,imagesStatesNeighboring:a,placeContinent:[{id:e,slug:"australie-a-oceanie",name:"Austrálie a Oceánie",area:8560000,population:42000000,population_density:4.9,number_states:14,information_chatgpt:"\u003Cp\u003E\u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E je kontinent, které se nachází na jižní polokouli. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E je největší zemí v Oceánii, zatímco Oceánie zahrnuje mnoho ostrovů v Tichomoří, včetně \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENového Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffidzi\"\u003EFidži\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nové Guiney\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fsamoa\"\u003ESamoa\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftonga\"\u003ETongy\u003C\u002Fa\u003E\u003C\u002Fb\u003E.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAustrálie\u003C\u002Fb\u003E je známá svými exotickými zvířaty, jako jsou \u003Cb\u003Eklokani\u003C\u002Fb\u003E, \u003Cb\u003Ekoaly\u003C\u002Fb\u003E a \u003Cb\u003Eemuové\u003C\u002Fb\u003E. Je také domovem mnoha překrásných pláží, kde se lze slunit, surfovat a potápět. Nejznámějšími městy jsou \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fsydney\"\u003ESydney\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmelbourne\"\u003EMelbourne\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbrisbane\"\u003EBrisbane\u003C\u002Fa\u003E\u003C\u002Fb\u003E. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fsydney\"\u003ESydney\u003C\u002Fa\u003E\u003C\u002Fb\u003E je známé svým \u003Cb\u003Eoperním domem\u003C\u002Fb\u003E a \u003Cb\u003EHarbour Bridge\u003C\u002Fb\u003E, \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fmelbourne\"\u003EMelbourne\u003C\u002Fa\u003E\u003C\u002Fb\u003E je považováno za kulturní centrum a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fbrisbane\"\u003EBrisbane\u003C\u002Fa\u003E\u003C\u002Fb\u003E je ideální pro milovníky adrenalinových sportů, jako je rafting a skákání padákem.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENový Zéland\u003C\u002Fa\u003E\u003C\u002Fb\u003E, má jedinečnou přírodu a kulturu. Nachází se zde mnoho přírodních památek, včetně hor, jezer a národních parků. Země je také domovem mnoha původních \u003Cb\u003EMaorů\u003C\u002Fb\u003E a jejich kultury. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fauckland\"\u003EAuckland\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fwellington\"\u003EWellington\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou největší města na \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENovém Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, zatímco \u003Cb\u003EQueenstown\u003C\u002Fb\u003E je oblíbená destinace pro turisty hledající adrenalinové sporty a krásnou přírodu.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nová Guinea\u003C\u002Fa\u003E\u003C\u002Fb\u003E je jednou z nejvíce odlehlých a exotických destinací na světě. Země je plná původních kmenů a mnoha z nich si stále zachovávají tradiční zvyky a rituály. Turisté sem jezdí kvůli krásným plážím a překrásné přírodě. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fmesto\u002Fport-moresby\"\u003EPort Moresby\u003C\u002Fa\u003E\u003C\u002Fb\u003E je hlavním městem země a láká návštěvníky svými muzei a historickými památkami.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EOceánie\u003C\u002Fb\u003E je také známá svými neuvěřitelnými korálovými útesy a podmořským životem. Korálové útesy \u003Cb\u003EVelký bariérový útes\u003C\u002Fb\u003E v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou největší na světě a lákají milovníky potápění z celého světa. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffidzi\"\u003EFidži\u003C\u002Fa\u003E\u003C\u002Fb\u003E a \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ftonga\"\u003ETonga\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou další oblíbené destinace pro potápěče a snorkelisty.\u003C\u002Fp\u003E\u003Cp\u003EMezi další známé ostrovy v \u003Cb\u003EOceánii\u003C\u002Fb\u003E patří \u003Cb\u003EHavajské ostrovy\u003C\u002Fb\u003E, které jsou součástí USA. \u003Cb\u003EHavajské ostrovy\u003C\u002Fb\u003E jsou známé svými surferskými plážemi, sopkami a krásnou přírodou. \u003Cb\u003ETahiti\u003C\u002Fb\u003E, největší ostrov \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffrancouzska-polynesie\"\u003EFrancouzské Polynésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E, láká návštěvníky svými luxusními resorty, bílými plážemi a modrými lagunami. \u003Cb\u003EBora Bora\u003C\u002Fb\u003E, jeden z ostrovů \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Ffrancouzska-polynesie\"\u003EFrancouzské Polynésie\u003C\u002Fa\u003E\u003C\u002Fb\u003E, je oblíbený mezi páry hledající romantickou dovolenou.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EOceánie\u003C\u002Fb\u003E má také bohatou historii a kulturu původních obyvatel. Původní obyvatelé \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENového Zélandu\u003C\u002Fa\u003E\u003C\u002Fb\u003E, \u003Cb\u003EMaorové\u003C\u002Fb\u003E, mají svou vlastní kulturu a jazyk. V \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E jsou původní obyvatelé \u003Cb\u003EAboridžinci\u003C\u002Fb\u003E, kteří mají svůj vlastní jazyk, tradice a umění. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fpapua-nova-guinea\"\u003EPapua Nová Guinea\u003C\u002Fa\u003E\u003C\u002Fb\u003E má mnoho různých původních kmenů, z nichž každý má své vlastní tradice a jazyk.\u003C\u002Fp\u003E\n\u003Cp\u003ECo se týče cestování do \u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E, musí cestovatelé získat víza pro vstup do země, pokud je to požadováno. \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E má mnoho mezinárodních letišť, zatímco v \u003Cb\u003EOceánii\u003C\u002Fb\u003E jsou letiště menší a mohou být omezenější. Mnoho ostrovů v \u003Cb\u003ETichomoří\u003C\u002Fb\u003E má také přísné pravidla pro dovoz zahraničních rostlin a zvířat, aby se chránila původní ekologie.\u003C\u002Fp\u003E\n\u003Cp\u003EV \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E a na mnoha ostrovech v \u003Cb\u003EOceánii\u003C\u002Fb\u003E se můžete potkat s tropickým klimatem s teplými lety a mírnými zimami. V některých částech \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003EAustrálie\u003C\u002Fa\u003E\u003C\u002Fb\u003E však může být klima velmi suché a horké, zatímco na jiných místech může být velmi vlhké a deštivé.\u003C\u002Fp\u003E\n\u003Cp\u003E\u003Cb\u003EAustrálie a Oceánie\u003C\u002Fb\u003E jsou také oblíbenými destinacemi pro adrenalinové sporty, jako je potápění, surfování, skákání padákem, rafting a další. Mnoho turistů také navštěvuje \u003Cb\u003EAustrálii a Oceánii\u003C\u002Fb\u003E kvůli sportovním akcím, jako jsou tenisové turnaje v \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Faustralie\"\u003EAustrálii\u003C\u002Fa\u003E\u003C\u002Fb\u003E, nebo ragbyové zápasy na \u003Cb\u003E\u003Ca href=\"https:\u002F\u002Fwww.frytolnacestach.cz\u002Fsvet\u002Fstat\u002Fnovy-zeland\"\u003ENovém Zélandu\u003C\u002Fa\u003E\u003Cb\u003E.\u003C\u002Fp\u003E",coordinates:[{latitude:-25.274398,longitude:133.775136}],type_place:"continent",id_image_cover:e,id_image_hero:e,zoom:[{google:o,booking:o}],information_author:a,seo_tags:a}],placesCities:[{id:1403,id_image_cover:a,importance:c,slug:"arno",type_place:d,name:"Arno"},{id:1406,id_image_cover:a,importance:c,slug:"bikini",type_place:d,name:"Bikini"},{id:1399,id_image_cover:a,importance:c,slug:"ebeye",type_place:d,name:"Ebeye"},{id:1400,id_image_cover:a,importance:c,slug:"jabor",type_place:d,name:"Jabor"},{id:1405,id_image_cover:a,importance:c,slug:"kwajalein",type_place:d,name:"Kwajalein"},{id:h,id_image_cover:a,importance:c,slug:p,type_place:d,name:q},{id:1402,id_image_cover:a,importance:c,slug:"mili",type_place:d,name:"Mili"},{id:1404,id_image_cover:a,importance:c,slug:"namdrik",type_place:d,name:"Namdrik"},{id:1407,id_image_cover:a,importance:c,slug:"rongelap",type_place:d,name:"Rongelap"},{id:1401,id_image_cover:a,importance:c,slug:"wotje",type_place:d,name:"Wotje"}],imagesCities:a,placeCityMain:[{id:h,id_state:n,name:q,population:28791,area:9.3,altitude:2,slug:p,information_chatgpt:a,coordinates:[{latitude:7.1164,longitude:171.1858}],biggest:"yes",type_place:d,id_image_cover:a,id_image_hero:a,affiliate:[{name:l,value:m}],alerts:a,zoom:[{google:10,booking:11}],parking:a,information_author:a,importance:c,seo_tags:a}],imageCityMain:a}],fetch:{"OrganismsoSidebarListComponent:0":{events:[],images:a}},mutations:[]}}(null,"05-2023","biggest","city",6,"09-2021",313,1398,"marshallovy-ostrovy","911","state","booking",true,143,3,"majuro","Majuro")));